contract MGCPresell is Ownable {
    using SafeMath for uint256;

    //BSC: 0x55d398326f99059fF775485246999027B3197955
    //BSC testnet: 0x7ef95a0fee0dd31b22626fa2e10ee6a223f8a684
    address public usdtMintAddress = 0x55d398326f99059fF775485246999027B3197955;

    //BSC testnet: 0x8BaBbB98678facC7342735486C851ABD7A0d17Ca //msc测试地址用eth代替
    //mainnet: 0xeacAd6c99965cDE0f31513dd72DE79FA24610767
    address public mscMintAddress = 0xeacAd6c99965cDE0f31513dd72DE79FA24610767;

    // testnet: 0x35f7e1Bdb53cEFf51Cb2095068DCd9675E27AEAd
    address public presellTokenMintAddress = 0x35f7e1Bdb53cEFf51Cb2095068DCd9675E27AEAd;
    address public marketAddress = 0x0AcBE26e03d67Fe316277A0FA8B35eB76b562cA6;

    //bsc: 0x10ED43C718714eb63d5aA57B78B54704E256024E
    //bsc testnet: 0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3
    address public pancakeRoute2 = 0x10ED43C718714eb63d5aA57B78B54704E256024E;

    // BSC testnet 1
    // BSC mainnet 500
    uint256 private preSellCoinPreAmount = 500 * 10 ** 18;

    // BSC testnet 10
    // BSC mainnet 1024
    uint256 private startAt;
    uint256 private endAt;

    // tesenet 600, mainnet 86400
    uint256 private timeStep = 86400; // 1day

    // mainnet 5 * 10 ** 18
    uint256 private priceStep = 5 * 10 ** 16;

    //testnet 1, mainnet 100 * 10 ** 18
    uint256 private baseMoney = 100 * 10 ** 18;

    uint32 private counter;
    uint32 private withdrawCounter;
    uint32 private preMax = 1024000;
    uint32 private buyMax = 5;

    IERC20 public immutable usdtToken;
    IERC20 public immutable mscToken;
    IERC20 public sellToken;
    
    mapping(address => uint256) public userPresellBalanceMap;
    mapping(address => uint32) public userPurchased;

    event BuyPresell(
        address indexed user,
        uint32  buyNumber,
        uint256 mscAmount,
        uint256 usdtAmount
    );

    event Withdraw(address indexed user, uint256 amount);

    constructor(
        uint256 _startAt,
        uint256 _endAt
        ) {
        require(_startAt >= block.timestamp, "start at < now");
        require(_endAt >= _startAt, "end at < start at");

        startAt = _startAt;
        endAt = _endAt;
        usdtToken = IERC20(usdtMintAddress);
        mscToken = IERC20(mscMintAddress);
        sellToken = IERC20(presellTokenMintAddress);
    }

    function setSellToken(address mint) public onlyOwner {
        presellTokenMintAddress =  mint;
        sellToken = IERC20(presellTokenMintAddress);
    }

    function getMscAmountOut(uint256 usdtAmountIn) public view returns (uint256) {
        address[] memory path = new address[](2);
        path[0] = usdtMintAddress;
        path[1] = mscMintAddress;
        uint[] memory amounts = IUniswapV2Router02(pancakeRoute2).getAmountsOut(usdtAmountIn, path);
        return amounts[1];
    }

    function getMscPrice(uint256 mscAmountIn) public view returns (uint256) {
        address[] memory path = new address[](2);
        path[0] = mscMintAddress;
        path[1] = usdtMintAddress;
        uint[] memory amounts = IUniswapV2Router02(pancakeRoute2).getAmountsOut(mscAmountIn, path);
        return amounts[1];
    }

    function getStep() public view returns (uint256) {
        uint curtime = block.timestamp;
        if(curtime < startAt) {
            return 0;
        }
        return curtime.sub(startAt).div(timeStep);
    }

    function getPriceStep() public view returns (uint256) {
        return priceStep;
    }
    
    function getPresellMscAndUsdtAmount() public view returns (uint256, uint256) {
        uint256 step = getStep();
        uint256 money = baseMoney.add(step.mul(priceStep));
        uint256 usdtAmount = money.mul(80).div(100);
        uint256 usdtToMscAmount = money.sub(usdtAmount);
        return (getMscAmountOut(usdtToMscAmount), usdtAmount);
    }

    function getBaseAmount() public view returns (uint256) {
        return baseMoney;
    }

    function getPresellMax() public view returns (uint32) {
        return preMax;
    }

    function getPreSellCoinAmount() public view returns (uint256) {
        return preSellCoinPreAmount;
    }

    function getUserPreSellCoinAmount(address user) public view returns (uint256) {
        return userPresellBalanceMap[user];
    }

    function getStartTime() public view returns (uint256) {
        return startAt;
    }

    function getEndTime() public view returns (uint256) {
        return endAt;
    }

    function getUserBuyQuantity(address user) public view returns (uint32) {
        return userPurchased[user];
    }

    function getPreSellCounter() public view returns (uint64) {
        return counter;
    }

    function getWithdrawCounter() public view returns (uint64) {
        return withdrawCounter;
    }

    function getBuyMax() public view returns (uint32) {
        return buyMax;
    }


    function buyTokens(uint32 quantity) public {
        require(startAt < block.timestamp, "not start");

        require(endAt > block.timestamp, "has end");

        require(counter <= preMax, "Pre-orders are sold out");

        require(quantity > 0, "quantity must more than zero");

        require(userPurchased[msg.sender] + quantity <= buyMax,"already purchased max");

        (uint256 mscAmount, uint256 usdtAmount) = getPresellMscAndUsdtAmount();
        mscAmount = mscAmount.mul(quantity);
        usdtAmount = usdtAmount.mul(quantity);

        require(usdtToken.allowance(msg.sender, address(this)) >= usdtAmount, "usdtToken allowance too low");
        require(mscToken.allowance(msg.sender, address(this)) >= mscAmount, "mscToken allowance too low");

        bool sent = usdtToken.transferFrom(msg.sender, marketAddress, usdtAmount);
        require(sent, "Usdt transfer failed");

        sent = mscToken.transferFrom(msg.sender, marketAddress, mscAmount);
        require(sent, "Msc transfer failed");
        userPresellBalanceMap[msg.sender] += preSellCoinPreAmount.mul(quantity);
        userPurchased[msg.sender] += quantity;
        counter += quantity;
        emit BuyPresell(msg.sender, quantity, mscAmount, usdtAmount);
    }

    function withdrawPresellTokens() public {
        require(endAt < block.timestamp, "presell not end");

        require(userPresellBalanceMap[msg.sender] > 0, 'user balance zero');

        uint256 amount = userPresellBalanceMap[msg.sender];

        bool sent = sellToken.transfer(msg.sender, amount);
        require(sent, "Token transfer failed");

        userPresellBalanceMap[msg.sender] = 0;
        withdrawCounter++;
        emit Withdraw(msg.sender, amount);
    }

    function setPresellMax(uint32 v) public onlyOwner {
        preMax = v;
    }

    function setMarketAddress(address newAddress) public onlyOwner {
        marketAddress = newAddress;
    }
    
    function setBaseAmount(uint256 newAmount) public onlyOwner {
        baseMoney = newAmount;
    }

    function setPriceStep(uint256 step) public onlyOwner {
        priceStep = step;
    }

    function setTimeStep(uint256 step) public onlyOwner {
        timeStep = step;
    }

    function setBuyMax(uint32 max) public onlyOwner {
        buyMax = max;
    }

    // Withdraw ETH that gets stuck in contract by accident
    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    function emergencyWithdrawToken(address token, uint256 amount) external onlyOwner {
        IERC20(token).transfer(msg.sender, amount);
    }

}

